    const costOfTheAsset = React.createRef();
    const salvageValue = React.createRef();
    const usefulLifeOfTheAsset = React.createRef();

    const [getResult, setGetResult] = useState(null);
    const fortmatResponse = (res) => {
        return JSON.stringify(res, null, 2);
    }

    async function OnSubmitCreateBusinessProperty() {
        // console.log(propertyId.current.value);
        const postData = {
                // customerId:"1",
                PropertyId: propertyId.current.value,
                BuildingSqft: parseInt(buildingSqft.current.value),
                BuildingType: buildingType.current.value,
                BuildingStoreys: parseInt(buildingStoreys.current.value),
                BuildingAge: parseInt(buildingAge.current.value),
                CostOfTheAsset: parseInt(costOfTheAsset.current.value),
                SalvageValue: parseInt(salvageValue.current.value),
                UsefulLifeOfTheAsset: parseInt(usefulLifeOfTheAsset.current.value)

        }

        // console.log(postData)

        await fetch("https://localhost:44334/api/Consumer/CreateBusinessProperty", {
            method: 'POST',
            headers: new Headers({
                'Accept': 'application/json',
                'Content-Type': 'application/json'
            }),
            body: JSON.stringify(postData)
        })
            .then(response => response.json())
            .then(data => {
                // console.log(data);
                setGetResult([data]);
            })
            .catch(error => {
                console.log("error")
            });
    }


    return (
        <>
            <Container>
                <h4>Enter Information</h4>
                <form>
                    <Col>
                        <FormGroup row>
                            <label htmlFor="PropertyId">PropertyId</label>
                            <Col sm={10}>
                                <input type="text" name="PropertyId" ref={propertyId} placeholder="Enter Id like P01" />
                            </Col>
                        </FormGroup>
                        <FormGroup row>
                            <label htmlFor="BuildingSqft">BuildingSqft</label>
                            <Col sm={10}>
                                <input type="number" name="BuildingSqft" ref={buildingSqft} placeholder="BuildingSqft" />
                            </Col>
                        </FormGroup>
                        <FormGroup row>
                            <label htmlFor="BuildingType">BuildingType</label>
                            <Col sm={10}>
                                <input type="text" name="BuildingType" ref={buildingType} placeholder="BuildingType" />
                            </Col>
                        </FormGroup>
                        <FormGroup row>
                            <label htmlFor="BuildingStoreys">BuildingStoreys</label>
                            <Col sm={10}>
                                <input type="number" name="BuildingStoreys" ref={buildingStoreys} placeholder="BuildingStoreys" />
                            </Col>
                        </FormGroup>
                        <FormGroup row>
                            <label htmlFor="buildingAge">BuildingAge</label>
                            <Col sm={10}>
                                <input type="Number" name="BuildingAge" ref={buildingAge} placeholder="BuildingAge" />
                            </Col>
                        </FormGroup>
                        <FormGroup row>
                            <label htmlFor="CostOfTheAsset">CostOfTheAsset</label>
                            <Col sm={10}>
                                <input type="number" name="CostOfTheAsset" ref={costOfTheAsset} placeholder="CostOfTheAsset" />
                            </Col>
                        </FormGroup>
                        <FormGroup row>
                            <label htmlFor="SalvageValue">SalvageValue</label>
                            <Col sm={10}>
                                <input type="number" name="SalvageValue" ref={salvageValue} placeholder="SalvageValue" />
                            </Col>
                        </FormGroup>
                        <FormGroup row>
                            <label htmlFor="UsefulLifeOfTheAsset">UsefulLifeOfTheAsset</label>
                            <Col sm={10}>
                                <input type="text" name="UsefulLifeOfTheAsset" ref={usefulLifeOfTheAsset} placeholder="UsefulLifeOfTheAsset" />
                            </Col>
                        </FormGroup>
                    </Col>
                    <Col>
                        <FormGroup row>
                            <Col sm={5}>
                            </Col>
                            <Col sm={1}>
                                <button type="button" onClick={() => OnSubmitCreateBusinessProperty()} className="btn btn-success">Submit</button>
                            </Col>
                            <Col sm={1}>
                                <Button color="danger">Cancel</Button>{' '}
                            </Col>
                            <Col sm={5}>
                            </Col>
                        </FormGroup>
                    </Col>
                </form>
                {getResult && <div className="alert alert-secondary mt-2" role="alert"><pre>{getResult}</pre></div>}

            </Container>
        </>
    );


};
export default AddProduct;
